import React from "react";
import Profile from "../Profile";

const Home = (props) => {
    return (
        <div className="individuals-container">
        <h3 className="greeting">Welcome to TOBY</h3>

            {this.state.individuals.map(props => (
                <Profile 
                    id={props.id}
                    name={props.name}
                    title={props.title}
                    img={props.img}
                /> 
            ))}
        </div>
    )
}


export default Home;
